window.bookSummaryJSON = "<p><b>My brother was right. I always wanted my own Willow girl.</b></p> <p>What happened on that island didn’t break me. It twisted me. Corrupted me. Made me into a monster.</p> <p>Although, I guess, it’s true what she says. You can’t become something that wasn’t inside you all along. </p> <p>This was always going to happen. I was always going to take Amelia Willow. History and destiny sealed her fate. Sealed both of ours. </p> <p>For months, I’ve been waiting. Watching. Preparing.</p> <p>And tonight, everything will change. Because tonight, I’ll collect my own Willow girl.</p> <p><b>Author’s note: </b><b><i>Twisted </i></b><b>is a stand-alone spin-off of the Dark Legacy Duet. No cliff-hanger! </b></p>"; 
